import React, {Component} from 'react';

class App extends Component {
    constructor(props) {
        super(props);
        this.state={
            latitude:null
        };
        window.navigator.geolocation.getCurrentPosition(
            position => {
                this.setState({latitude:position.coords.latitude})
            },
            err=>console.log(err)
        );
    }





    render() {
        return (
            <div>
                {this.state.latitude}
            </div>
        );
    }
}

export default App;
